  true,\n\t\"url\": null,\n\t\"notes\": \"Power electronics play an increasingly important
  role in energy applications as part of their power converter circuits. Understanding
  the behavior of these devices, especially their failure modes as they age with nominal
  usage or sudden fault development is critical in ensuring efficiency. In this paper,
  a prognostics based health management of power MOSFETs undergoing accelerated aging
  through electrical overstress at the gate area is presented. Details of the accelerated
  aging methodology, modeling of the degradation process of the device and prognostics
  algorithm for prediction of the future state of health of the device are presented.
  Experiments with multiple devices demonstrate the performance of the model and the
  prognostics algorithm as well as the scope of application.rnIndex Termsu2014Power
  MOSFET, accelerated aging, prognostics.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
